import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
    return (
      <div className='home'>

          <Navigation />
           <div className="home-content">
                    <h1>Thomas Bressel</h1>
                    <h2>Développeur Front-end</h2>
                    <img src="../medias/code.jpg" alt="img-code" />
                    <div className="home-content-pdf">
                        <a href="#" target='_blank'>Télécharger CV</a>
                    </div>
                </div>  
        </div>
    );
};

export default Home;
